import React, { useEffect, useState } from 'react';
import Navbar from '../navSection/Navbar';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Button from 'react-bootstrap/Button';

const Test = () => {
  const [query, setQuery] = useState('');
  useEffect(() => {
    // Check if Geolocation is supported
    if ('geolocation' in navigator) {
      // Request current location
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;

          // Construct the map URL with user's coordinates
          const mapUrl = `https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d126844.06348606381!2d${longitude}!3d${latitude}!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sng!4v1706517127493!5m2!1sen!2sng`;

          // Set the iframe source
          document.getElementById('map-iframe').src = mapUrl;
        },
        (error) => {
          console.error('Error getting user location:', error);
        }
      );
    } else {
      console.error('Geolocation is not supported by this browser.');
    }
  }, []); // Run once when the component mounts

  return (
    <div>
      <Navbar />
      <iframe
        width="100%"
        height="300"
        title="Google Map Embed"
        id="map-iframe"
        src=""
        style={{ border: '0' }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
      ></iframe>
      <Form className='mx-2'>
        <InputGroup className="mb-3 ">
          <Form.Control
            placeholder="Search for eateries near you!"
            aria-describedby="search"
            id="search"
            className="border border-success"
            onChange={(e) => setQuery(e.target.value)}
            autoComplete="new-password"
          />
          <Button
            variant="success"
            id="basic-addon1"
            className=" text-white fw-bold d-flex align-items-center"
          >
            <SearchOutlinedIcon />
            Search
          </Button>
        </InputGroup>
      </Form>
    </div>
  );
};

export default Test;
